import React, { createElement } from 'react'
import { storiesOf } from '@storybook/react'
import { EditButton } from 'common-components'
import notes from './notes.md'

const stories = storiesOf('EditButton', module)

stories.add(
  'default',
  () =>
    createElement(() => {
      return (
        <>
          <EditButton onClickFunc={() => { alert("Edit button") }} text={"Try Me!"} />
        </>
      )
    }),
  { notes: { markdown: notes } }
)

stories.add(
  'With Style',
  () =>
    createElement(() => {
      return (
        <>
          <EditButton
            onClickFunc={() => { alert("Edit button") }}
            text={"Customize"}
            style={{ backgroundColor: "red", width: "100px", height: "100px" }} //button style
            iconStyle={{ backgroundColor: "white" }}
            textStyle={{ fontStyle: "italic" }}
          />
        </>
      )
    }),
  { notes: { markdown: notes } }
)
